import { Runner, Stage } from "./BeforeRace";

type CurrentRunner = {
  runner: Runner;
  stage: Stage;
  scheduleDifference: number;
};

const AfterStart = () => {
  return (
    <>
      <span className="font-bold text-lg">Current runner</span>
      <div className="w-full bg-gradient-to-r from-pink to-purple-2 rounded-2xl flex flex-col px-6 text-white">
        <span className="text-2xl"></span>
      </div>
    </>
  );
};

export default AfterStart;
